import React, { useState, useRef, useEffect } from "react";
import { QRCode } from "react-qrcode-logo";
import html2canvas from "html2canvas";
import axios from "axios";
import "./assetRegister.css";

const AssetRegister = () => {
  const user = JSON.parse(localStorage.getItem("currentUser"));

  const [name, setName] = useState(user?.username || "");
  const [company, setCompany] = useState("");
  const [department, setDepartment] = useState("");
  const [mainCategory, setMainCategory] = useState("");
  const [type, setType] = useState("");
  const [categories, setCategories] = useState([]);
  const [types, setTypes] = useState([]);
  const [assetName, setAssetName] = useState("");
  const [assetUpdateDate, setAssetUpdateDate] = useState("");
  const [serialNumber, setSerialNumber] = useState("");
  const [qrCodeData, setQrCodeData] = useState(null);
  const [trackingId, setTrackingId] = useState("");
  const [specialNote, setSpecialNote] = useState("");
  const [customType, setCustomType] = useState("");
  const [computerComponent, setComputerComponent] = useState("");

  const qrCodeContainerRef = useRef();

  useEffect(() => {
    fetchCategories();
  }, []);

  useEffect(() => {
    if (mainCategory) filterTypes();
    else setTypes([]);
  }, [mainCategory, categories]);

  const fetchCategories = async () => {
    try {
      const response = await axios.get("http://localhost:8000/api/categories/getCategory");
      setCategories(response.data);
    } catch (error) {
      console.error("Error fetching categories:", error);
    }
  };

  const filterTypes = () => {
    const filtered = categories
      .filter((category) => category.category === mainCategory)
      .map((category) => category.types)
      .flat();
    setTypes(filtered);
  };

  const handleComponentChange = (e) => {
    setComputerComponent(e.target.value);
  };

  return (
    <div className="asset-register">
      <h2>Asset Registration</h2>
      <select value={type} onChange={(e) => setType(e.target.value)}>
        <option value="">Select Type</option>
        {types.map((t, index) => (
          <option key={index} value={t}>{t}</option>
        ))}
        <option value="Other">Other</option>
      </select>
      {type === "Other" && (
        <input
          type="text"
          value={customType}
          onChange={(e) => setCustomType(e.target.value)}
          placeholder="Enter Custom Type"
        />
      )}
      {type === "Computer" && (
        <div className="computer-options">
          <label><input type="radio" name="computerComponent" value="fullSet" onChange={handleComponentChange} checked={computerComponent === "fullSet"} /> Full Set</label>
          <label><input type="radio" name="computerComponent" value="monitor" onChange={handleComponentChange} checked={computerComponent === "monitor"} /> Monitor</label>
          <label><input type="radio" name="computerComponent" value="cpu" onChange={handleComponentChange} checked={computerComponent === "cpu"} /> CPU</label>
          <label><input type="radio" name="computerComponent" value="mouse" onChange={handleComponentChange} checked={computerComponent === "mouse"} /> Mouse</label>
          <label><input type="radio" name="computerComponent" value="keyboard" onChange={handleComponentChange} checked={computerComponent === "keyboard"} /> Keyboard</label>
          <label><input type="radio" name="computerComponent" value="motherboard" onChange={handleComponentChange} checked={computerComponent === "motherboard"} /> Motherboard</label>
          <label><input type="radio" name="computerComponent" value="ram" onChange={handleComponentChange} checked={computerComponent === "ram"} /> RAM</label>
          <label><input type="radio" name="computerComponent" value="powersupply" onChange={handleComponentChange} checked={computerComponent === "powersupply"} /> Power Supply</label>
          <label><input type="radio" name="computerComponent" value="processor" onChange={handleComponentChange} checked={computerComponent === "processor"} /> Processor</label>
        </div>
      )}
    </div>
  );
};

export default AssetRegister;
